import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Weather from '../../Components/Weather/Weather';

function History() {

    const [weathers, setWeathers] = useState([])

    useEffect(() => {

        axios.get("http://localhost:5000/weather/").then((response) => {
            console.log(response.data.data)
            let data = response.data
            setWeathers(data);

        })

    }, [])
    return (
        <div className='row'>


            <div className='loop-col'>
                <div className='map-container'>
                    <div className='row' >

                        

                            {weathers.map((obj, index) => {

                                let { cityname, country, lon, lat, dayone } = obj
                                let { date, mintemp, maxtemp, avgtemp, text, icon, code } = dayone
                                return (
                                    <div className='col-6'>
                                    <Weather key={obj._id} title={cityname} lat={lat} long={lon} maxtemp={maxtemp} mintemp={mintemp} avgtemp={avgtemp} text={text} icon={icon} country={country} date={date} code={code} isCard />
                                    </div>
                                )

                            })}


                        



                    </div>
                </div>



            </div>

        </div>
    )
}

export default History
